import { makeStyles } from "@mui/styles";

export default makeStyles({
  container: {
    height: '100vh',
    paddingTop: '120px',
  },
  isEmpty: {
    background: 'rgb(145 145 145 / 21%)',
    display: 'block',
    margin: '50px',
    width: 'fit-content',
    padding: '20px'
  },
  goBack: {
    color: 'purple', 
    marginLeft: '40px'
  }
});
